            return `${dbDataType}(${dataLen ? dataLen : 128})`;
        } else if(dbDataType.toUpperCase() === 'DATE' ||
            dbDataType.toUpperCase() === 'YEAR' ||
            dbDataType.toUpperCase() === 'TINYTEXT' ||
            dbDataType.toUpperCase() === 'MEDIUMTEXT' ||
            dbDataType.toUpperCase() === 'LONGTEXT' ||
            dbDataType.toUpperCase() === 'TINYBLOB' ||
            dbDataType.toUpperCase() === 'MEDIUMBLOB' ||
            dbDataType.toUpperCase() === 'LONGBLOB' ||
            dbDataType.toUpperCase() === 'BOOLEAN' ||
            dbDataType.toUpperCase() === 'FLOAT' ||
            dbDataType.toUpperCase() === 'INT' ||
            dbDataType.toUpperCase() === 'JSON' ) {
            return dbDataType;
        } else if(dbDataType.toUpperCase() === 'ENUM' ||
            dbDataType.toUpperCase() === 'SET' ) {
            return `${dbDataType}(${defaultValue})`;
        } else if(dbDataType.toUpperCase() === 'TIME' ||
            dbDataType.toUpperCase() === 'DATETIME' ||
            dbDataType.toUpperCase() === 'TIMESTAMP') {
            return `${dbDataType}${(dataLen && dataLen >= 0 && dataLen <= 6) ? `(${dataLen})` : ''}`;
        } else if(dbDataType.toUpperCase() === 'DOUBLE') {
            return `${dbDataType}${computeLenAndNum(dataLen, numScale, 255, 30)}`;
        } else if(dbDataType.toUpperCase() === 'DECIMAL') {
            return `${dbDataType}${computeLenAndNum(dataLen, numScale, 65, 30)}`;
        } else if(dataLen && dataLen > 0) {
            return `${dbDataType}(${dataLen})`;
        }
        return `${dbDataType}`;
    };
    let schemaName = it.schemaName ? `${it.schemaName}.` : '';
    const tableKey = `${schemaName}${it.defKey}`;
}}
